def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item > bins[i]:
            priorities[i] = -1
        else:
            left_capacity = bins[i] - item
            if left_capacity == 0:
                priorities[i] = 0
            else:
                utilization = item / bins[i]
                if utilization < 0.2:
                    priorities[i] = 1 / (1 - utilization)
                elif 0.2 <= utilization <= 0.5:
                    priorities[i] = 2
                elif 0.5 < utilization <= 0.8:
                    sub_priority = 0
                    for j in range(1, int(item/2)+1):
                        if item % j == 0:
                            sub_priority += j
                    priorities[i] = sub_priority
                else:
                    remaining_ratio = left_capacity / item
                    sub_priority = 0
                    for k in range(2, int(item**0.5)+1):
                        if item % k == 0:
                            sub_priority += k
                    priorities[i] = np.sqrt(item * remaining_ratio) + sub_priority

    return priorities
